import "./main.css";

import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ChatApp() {
  const [messages, setMessages] = useState([]);
  const [newMessage, setNewMessage] = useState('');
  const [isLoading, setIsLoading] = useState(false);

  // Получаем все сообщения при загрузке страницы
  useEffect(() => {
    fetchMessages();
  }, []);

  async function fetchMessages() {
    try {
      const response = await axios.get('http://localhost:8000/api/messages/');
      setMessages(response.data);
    } catch (error) {
      console.error(error);
    }
  }

  async function handleSubmit(event) {
    event.preventDefault();
    setIsLoading(true);
    setNewMessage('');
    try {
      const response = await axios.post(
        'http://localhost:8000/api/messages/',
        { text: newMessage },
        { headers: { 'Content-Type': 'application/json' } }
      );
      
      setIsLoading(false);
      setMessages([...messages, { text: newMessage, processed_text: response.data.processed_text }]);
      
    } catch (error) {
      console.error(error);
      setIsLoading(false);
    }
  }
  const containerStyle = {
    whiteSpace: 'pre-wrap', // Эффект, аналогичный <pre>
    wordWrap: 'break-word', // Перенос слов
    // Вы можете добавить другие стили сюда
  };
  

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          value={newMessage}
          onChange={(e) => setNewMessage(e.target.value)}
          placeholder="Введите сообщение..."
        />
        <button type="submit">Отправить</button>
      </form>
      {isLoading && <span>Загрузка...</span>}
      {messages.length === 0 ? (
          <div className='nomessage'>
             <div className="container-nomessage">
                  <div className="maintext-nomessage">
                       Сообщений пока нет...
                  </div>
                  <div className="text-nomessage">
                       Задайте мне любой вопрос и я постараюсь дать вам ответ
                  </div>
                  <div className='img-nomessage'>
                        <img className='gif-nomessage' src="https://i.yapx.cc/YQuRO.gif" alt="" />               
                  </div>
              </div>
              <div className="input-container">
                  <input
                      type="text"
                      value={message}
                      onChange={handleInputChange}
                      onKeyDown={handleKeyDown}
                      placeholder="Cообщение"
                  />
                  <button className="button"onClick={handleSendMessage} disabled={!message}>
                      <svg width="16" height="17" viewBox="0 0 16 17" fill="none" xmlns="http://www.w3.org/2000/svg"><rect x="7.00391" width="2" height="17" rx="1" fill="white"/> <rect x="7.15625" y="1.26416" width="1.78777" height="10.7266" rx="0.893885" transform="rotate(-45 7.15625 1.26416)" fill="white"/> <rect x="7.58594" width="1.78777" height="10.7266" rx="0.893885" transform="rotate(45 7.58594 0)" fill="white"/></svg>
                  </button>
              </div>
          </div> 
                                
        
      ) : (
        messages.map((message, index) => (
          
          <div key={index}>
            <p>{message.text}</p>
            
            <div style={containerStyle}>{message.processed_text}</div>
          </div>
        ))
      )}
    </div>
  );
}

export default ChatApp;
